import React from "react";
import {ref} from './App';

function DataBlock({dev}){

    function deleteDoc(docx){
          ref
          .doc(docx.id)
          .id.delete()
          .catch((err)=>{
            alert(err)
            console.error(err);
          })
    }
    return(
       <div key={dev.id}>
            <h1>Name:{dev.name}</h1>
            <p>skill:{dev.skill}</p>
            <button onClick={()=>deleteDoc(dev)}>Delete</button>
            <button>Edit</button>
        </div>
    )
}
export default DataBlock
